public class Day5 {
    static String input = "";

    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder(input);
        boolean changed = true;
        while (changed) {
            changed = false;
            for (int i = 0; i < sb.length() - 1; i++) {
                char a = sb.charAt(i);
                char b = sb.charAt(i + 1);
                if (Math.abs(a - b) == 32) {
                    sb.deleteCharAt(i);
                    sb.deleteCharAt(i);
                    i--;
                    changed = true;
                }
            }
        }
        System.out.println(sb.length());
    }
}
